// src/App.js
import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import HomePage from './components/HomePage';
import DistrictCourt from './components/DistrictCourt';
import HighCourt from './components/HighCourt';
import SupremeCourt from './components/SupremeCourt';
import StateSelection from './components/StateSelection'; // Import the new component

import './styles/styles.css';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<HomePage />} />
        <Route path="/district" element={<DistrictCourt />} />
        <Route path="/high" element={<StateSelection />} /> {/* Route for State Selection */}
        <Route path="/supreme" element={<SupremeCourt />} />
        {/* You can add additional routes for specific states */}
        <Route path="/high/:state" element={<HighCourt />} /> {/* Placeholder route for state-specific High Court */}
      </Routes>
    </Router>
  );
}

export default App;
